import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import React from "react";
import { render } from "react-dom";
import DangNhapGH from "./components/dangnhap";
import DanhSachDH from "./components/"
class NhanVienGH extends React.Component {
    render() {
        return(
            <Router>
                <div>
                    <Route exact path="/login"><DangNhapGH/></Route>
                    <Route exact path="/danhsachgh">DanhSachDH</Route>
                </div>
            </Router>
        );
    };
}
export default NhanVienGH;
